import React from "react";
import * as FaIcons from "react-icons/fa";

export const SidebarData = [
  {
    title: "Dashboard",
    path: "/",
    icon: <FaIcons.FaThLarge />,
    cName: "nav-item",
  },
  {
    title: "History",
    path: "/history",
    icon: <FaIcons.FaHistory />,
    cName: "nav-item",
  },
  {
    title: "Charts",
    path: "/charts",
    icon: <FaIcons.FaChartPie />,
    cName: "nav-item",
  },
  {
    title: "About",
    path: "/about",
    icon: <FaIcons.FaInfoCircle />,
    cName: "nav-item",
  },
];
